import React from 'react';
import logo from './logo.svg';
import 'semantic-ui-css/semantic.min.css'
import NavigationBar from './navigation';
import FeedExampleBasic from './Feed';
import MenuExampleCompact from './Footer';
import './App.css';

function App() {
  return (
    <div >
      <header className="App-header">
        Header
      </header>
        <div className="App">
            <NavigationBar />
        </div>
        <div>
            <FeedExampleBasic />
        </div>
        <div>
            <MenuExampleCompact />
        </div>
    </div>
  );
}

export default App;
